import * as Papa from 'papaparse';


export async function loadFile(context, fileName, fileObject, errorToggle){
    const reader = new FileReader();
    reader.readAsText(fileObject, "UTF-8");
    reader.onload = event => {
        const file = { name: fileName, text: event.target.result };
        parseFile(context,file,fileName,errorToggle);
    };
}


export function parseCSV(context,file,fileName,errorToggle){
    Papa.parse(file.text, {
        header: true,
        complete: function(CSVFilePlaces) {
            let CSVPlaces = CSVFilePlaces.data;
            correctFormat(context,CSVPlaces,fileName,errorToggle);
            console.log("Building trip from CSV file.");
        }
    });
}
